INSERT INTO `noticias` VALUES (4,'2003-05-05','CONSTRUCCION 368-369 PARA IZAR GIJÓN','Izar Gijón new construction 368-369','Gabadi, S.L. está realizando la habilitación llave en mano de 2 dragas para el famoso armador Jan de Nul. Dichos barcos se entregarán a finales del 2003.','',,'PIC00014.jpg','image/pjpeg',1),(5,'2003-01-01','Gabadi Amplía sus Instalaciones','','Gabadi, S.L. ha ampliado sus instalaciones en 1.200 m2 para incrementar su ámbito de actuación en el Sector Calderero.','',NULL,NULL,NULL,0),(6,'2004-11-18','Nueva acomodación realizada para Jan de Nul','New accomodation to Jan de Nul','Gabadi, S.L. ha realizado satisfactoriamente una nueva acomodación para el Armador Belga (Jan de Nul). Dicha habilitación ha sido desarrollada en el Buque Vesalius. Buque de 93,25m de eslora.','Gabadi, S.L. just have finised new accomodation to Jan de Nul. This accomodation has made in the Vesalius vessel. Length Overall 93.25 m Length Overdeck 70.2 m. Width 17 m.',,'Vesalius3.jpg','image/pjpeg',0);
